import React, { Component } from 'react';
import Clarifai from 'clarifai';
import Navigation from './Components/Navigation/Navigation';
import Logo from './Components/Logo/Logo';
import ImageLinkForm from './Components/ImageLinkForm/ImageLinkForm';
import Rank from './Components/Rank/Rank'
// import FaceRecognition from './Components/FaceRecognition/FaceRecognition';
import Particles from 'react-particles-js';

import './App.css';

const app = new Clarifai.App({
	apikey: '46cd60645f2f41178e02fc35b1ad7ed7'
})


const particleOptions = {
	particles: {
		number: {
			value: 30,
		density: {
			enable: true,
			value_area: 800,
		}
	}
}
}

class App extends Component {
	constructor() {
		super();
		this.state = {
			input: '',
		}
	} 


onInputChange = (event) => {
	console.log(event.target.value);
	app.models.predict("a403429f2ddf4b49b307e318f00e528b", "https://samples.clarifai.com/face-det.jpg").then(
    function(response) {
      console.log(response);
    },
    function(err) {
      // there was an error
    }
  );
}

// To get the value of the input, you need to use the above code in the console.log paramaters

onButtonSubmit = () => {
	console.log('Click')
}

helloThere = () => {
	console.log('CLick')
}

render() {
	return (
		<div className="App">
			 <Particles className='Particles1'
			 	params={particleOptions}
			 />
			 <Navigation />
			 <Logo />
			 <Rank />
			 <ImageLinkForm onInputChange={this.onInputChange} helloThere={this.helloThere}/> 
		      {/*<FaceRecognition />*/}
		</div>
	);
}
}

export default App;


 // For onInputChange to work, you have to use this. as it is a property of the app, otherwise it is undefined and will not register.
